export default function ProjectIcons({ figure }) {
    return (
        <>
            {
                (figure === "cube") && <Cube />
            }{
                (figure === "add") && <Add />
            }{
                figure === "back" && <Back />
            }{
                figure === "up" && <Up />
            }{
                figure === "down" && <Down />
            }{
                figure === "dots" && <Dots />
            }{
                figure === "square" && <Square />
            }{
                figure === "sixedge" && <SixEdge />
            }{
                figure === "tube" && <Tube />
            }{
                figure === "triangle" && <Triangle />
            }{
                figure === "book" && <Book />
            }{
                figure === "projectplaceholder" && <ProjectPlaceholder/>
            }

        </>
    )
}

